actionConfiguration.body:
() => {
		if (Locator.selectedMarker === undefined) {
			return []
		}
		const markers = api_getRecentNearby.data.map((bird) => {
			return {
					"lat": utils.fuzzy(bird.lat),
					"long": utils.fuzzy(bird.lng),
					"title": bird.comName,
					"color": Locator.selectedMarker == bird? "#0000ff":"#ff0000"
				}
		})
		return markers.filter(x => (x.title))
	}

